INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20501, 25566, 'Quetiapine', 'Hyperglycemia', 'Hyperglycemia, in some cases extreme and associated with ketoacidosis or hyperosmolar coma or death, has been reported with the use of atypical antipsychotic agents.  Patients with diabetes should be monitored for worsening control of blood glucose when treated with these agents.  It is recommended that patients with risk factors for diabetes mellitus starting treatment with atypical antipsychotics should undergo fasting blood glucose testing at the beginning of treatment, and periodically thereafter.  Any patient treated with atypical antipsychotics should be monitored for symptoms of hyperglycemia including polydipsia, polyuria, polyphagia, and weakness.  Patients who develop symptoms of hyperglycemia during treatment with atypical antipsychotics should undergo fasting blood glucose testing.  In some cases, hyperglycemia has resolved when treatment with these agents was discontinued; however, some patients required continuation of anti-diabetic treatment despite discontinuation of the atypical antipsychotic drug.', '2', '"Product Information. Clozaril (clozapine)." Novartis Pharmaceuticals  (2001):|"Product Information. Risperdal (risperidone)." Janssen Pharmaceuticals  (2001):|"Product Information. Zyprexa (olanzapine)." Lilly, Eli and Company  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Abilify (aripiprazole)." Bristol-Myers Squibb  (2002):|"Product Information. Invega (paliperidone)." Janssen Pharmaceuticals  (2007):|"Product Information. Fanapt (iloperidone)." Vanda Pharmaceuticals Inc  (2009):|"Product Information. Saphris (asenapine)." Schering-Plough Corporation  (2009):|"Product Information. Latuda (lurasidone)." Sunovion Pharmaceuticals Inc  (2010):|"Product Information. Rexulti (brexpiprazole)." Otsuka American Pharmaceuticals Inc  (2015):|"Product Information. Vraylar (cariprazine)." Actavis Pharma, Inc.  (2015):|"Product Information. Caplyta (lumateperone)." Intra-Cellular Therapies, Inc.  (2022):', 'DDInter', 0);
