INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20515, 1191, 'Quetiapine', 'Hypotension', 'The use of atypical antipsychotic agents has been associated with orthostatic hypotension and syncope.  Therapy with atypical antipsychotics should be administered cautiously in patients with hypotension or conditions that could be exacerbated by hypotension, such as a history of myocardial infarction, angina, or ischemic stroke.  Patients with dehydration (e.g., due to severe diarrhea or vomiting) may be predisposed to hypotension and should also be managed carefully during therapy with atypical antipsychotics.  Blood pressure should be monitored at regular intervals, particularly during dosage escalation or whenever dosage has been altered, and patients should be advised not to rise abruptly from a sitting or recumbent position.', '2', '"Product Information. Clozaril (clozapine)." Novartis Pharmaceuticals  (2001):|"Product Information. Risperdal (risperidone)." Janssen Pharmaceuticals  (2001):|"Product Information. Zyprexa (olanzapine)." Lilly, Eli and Company  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Abilify (aripiprazole)." Bristol-Myers Squibb  (2002):|"Product Information. Invega (paliperidone)." Janssen Pharmaceuticals  (2007):|"Product Information. Fanapt (iloperidone)." Vanda Pharmaceuticals Inc  (2009):|"Product Information. Saphris (asenapine)." Schering-Plough Corporation  (2009):|"Product Information. Latuda (lurasidone)." Sunovion Pharmaceuticals Inc  (2010):|"Product Information. Rexulti (brexpiprazole)." Otsuka American Pharmaceuticals Inc  (2015):|"Product Information. Vraylar (cariprazine)." Actavis Pharma, Inc.  (2015):|"Product Information. Caplyta (lumateperone)." Intra-Cellular Therapies, Inc.  (2022):', 'DDInter', 0);
