INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20611, 1191, 'Quetiapine', 'Priapism', 'Atypical antipsychotic agents with alpha-adrenergic blocking effects may cause priapism.  The condition is characterized by prolonged, often painful erections lasting longer than 4 hours.  If not treated promptly, priapism can cause irreversible damage to the erectile tissue.  Therapy with these agents should be administered cautiously in patients with a history of priapism, conditions that may predispose them to priapism (e.g., sickle cell anemia, multiple myeloma, leukemia, thalassemia), or anatomical deformations of the penis (e.g., angulation, cavernosal fibrosis, Peyronie''s disease).  Patients who experience an erection lasting longer than 4 hours, whether painful or not, should immediately discontinue the drug and seek emergency medical attention.', '2', '"Product Information. Risperdal (risperidone)." Janssen Pharmaceuticals  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Invega (paliperidone)." Janssen Pharmaceuticals  (2007):|"Product Information. Fanapt (iloperidone)." Vanda Pharmaceuticals Inc  (2009):', 'DDInter', 0);
