INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20659, 1191, 'Quetiapine', 'Weight Gain', 'Weight gain has been observed with atypical antipsychotic use.  While all agents in the class have been shown to produce some changes, each drug has its own specific risk profile.  When treating pediatric patients with atypical antipsychotic agents, weight gain should be monitored and assessed against that expected for normal growth.  Monitor weight at baseline and frequently thereafter.', '2', '"Product Information. Clozaril (clozapine)." Novartis Pharmaceuticals  (2001):|"Product Information. Risperdal (risperidone)." Janssen Pharmaceuticals  (2001):|"Product Information. Zyprexa (olanzapine)." Lilly, Eli and Company  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Abilify (aripiprazole)." Bristol-Myers Squibb  (2002):|"Product Information. Invega (paliperidone)." Janssen Pharmaceuticals  (2007):|"Product Information. Fanapt (iloperidone)." Vanda Pharmaceuticals Inc  (2009):|"Product Information. Saphris (asenapine)." Schering-Plough Corporation  (2009):|"Product Information. Latuda (lurasidone)." Sunovion Pharmaceuticals Inc  (2010):|"Product Information. Rexulti (brexpiprazole)." Otsuka American Pharmaceuticals Inc  (2015):|"Product Information. Vraylar (cariprazine)." Actavis Pharma, Inc.  (2015):', 'DDInter', 0);
