INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20707, 1191, 'Quetiapine', 'Hyperprolactinemia', 'The chronic use of neuroleptic agents can cause persistent elevations in prolactin levels due to antagonism of dopamine D2 receptors.  Based on in vitro data, approximately one-third of human breast cancers are thought to be prolactin-dependent.  The clinical significance of this observation with respect to long-term neuroleptic therapy is unknown.  Chronic administration of neuroleptic drugs has been associated with mammary tumorigenesis in rodent studies but not in human clinical or epidemiologic studies.  Until further data are available, therapy with neuroleptic agents should be administered cautiously in patients with a previously detected breast cancer.  Caution is also advised in patients with preexisting hyperprolactinemia.  Hyperprolactinemia may suppress hypothalamic gonadotrophin releasing hormone (GnRH), resulting in reduced pituitary gonadotropin secretion.  This, in turn, may inhibit reproductive function by impairing gonadal steroidogenesis in both female and male patients.  Galactorrhea, amenorrhea, gynecomastia, and impotence have been reported in patients receiving prolactin-elevating compounds; however, the clinical significance of elevated serum prolactin levels is unknown for most patients.  Long-standing hyperprolactinemia when associated with hypogonadism may lead to decreased bone density in both female and male patients.', '2', 'Meco G, Falaschi P, Casacchia M, et al. "Neuroendocrine effects of haloperidol decanoate in patients with chronic schizophrenia." Adv Biochem Psychopharmacol 40 (1985):  89-93|Ash PR, Bouma D "Exaggerated hyperprolactinemia in response to thiothixene ." Arch Neurol 38 (1981):  534-5|"Product Information. Haldol (haloperidol)." McNeil Pharmaceutical  (2002):|"Product Information. Navane (thiothixene)." Roerig Division  (2001):|Huang ML, Van Peer A, Woestenborghs R, De Coster R, Heykants J, Jansen AA, Zylicz Z, Visscher HW, Jonkman JH "Pharmacokinetics of the novel antipsychotic agent risperidone and the prolactin response in healthy subjects." Clin Pharmacol Ther 54 (1993):  257-68|"Product Information. Clozaril (clozapine)." Novartis Pharmaceuticals  (2001):|"Product Information. Risperdal (risperidone)." Janssen Pharmaceuticals  (2001):|"Product Information. Compazine (prochlorperazine)." SmithKline Beecham  (2001):|Dickson RA, Dalby JT, Williams R, Edwards AL "Risperidone-induced prolactin elevations in premenopausal women with schizophrenia." Am J Psychiatry 152 (1995):  1102-3|"Product Information. Zyprexa (olanzapine)." Lilly, Eli and Company  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Moban (molindone)." Gate Pharmaceuticals  (2001):|"Product Information. Orap (pimozide)." Gate Pharmaceuticals|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Loxitane C (loxapine)." Apothecon Inc  (2022):|Bai YM, Ciu HJ, Guo ZZ "Risperidone-induced hyperprolactinemia in an elderly woman." Am J Psychiatry 159 (2002):  2112', 'DDInter', 0);
