INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20755, 1191, 'Quetiapine', 'Liver Diseases', 'Most neuroleptic agents are extensively metabolized by the liver.  The plasma concentrations of these agents may be increased and the half-lives prolonged in patients with impaired hepatic function.  Therapy with neuroleptic agents should be administered cautiously in patients with significant liver disease.  Lower initial dosages and slower titration may be appropriate.', '2', 'Hobbs DC, Welch WM, Short MJ, Moody WA, Van der Velde CD "Pharmacokinetics of thiothixene in man." Clin Pharmacol Ther 16 (1974):  473-8|Hobbs DC "Metabolism of thiothixene." J Pharm Sci 57 (1968):  105-11|Jann MW, Grimsley SR, Gray EC, Chang WH "Pharmacokinetics and pharmacodynamics of clozapine." Clin Pharmacokinet 24 (1993):  161-76|"Product Information. Navane (thiothixene)." Roerig Division  (2001):|Heel RC, Brogden RN, Speight TM, Avery GS "Loxapine: a review of its pharmacological properties and therapeutic efficacy as an antipsychotic agent." Drugs 15 (1978):  198-217|"Product Information. Clozaril (clozapine)." Novartis Pharmaceuticals  (2001):|"Product Information. Zyprexa (olanzapine)." Lilly, Eli and Company  (2001):|"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):|"Product Information. Moban (molindone)." Gate Pharmaceuticals  (2001):|"Product Information. Geodon (ziprasidone)." Pfizer U.S. Pharmaceuticals  (2001):|"Product Information. Loxitane C (loxapine)." Apothecon Inc  (2022):', 'DDInter', 0);
