INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20803, 1191, 'Quetiapine', 'Parkinsonian Disorders', 'The use of neuroleptic agents is associated with pseudo-parkinsonian symptoms such as akinesia, bradykinesia, tremors, pill-rolling motion, cogwheel rigidity, and postural abnormalities including stooped posture and shuffling gait.  The onset is usually 1 to 2 weeks following initiation of therapy or an increase in dosage.  Older neuroleptic agents such as haloperidol are more likely to induce these effects, and their use may be contraindicated in patients with Parkinson''s disease or parkinsonian symptoms.', '2', 'Moleman P, Janzen G, von Bargen BA, et al. "Relationship between age and incidence of parkinsonism in psychiatric patients treated with haloperidol." Am J Psychiatry 143 (1986):  232-4|"Product Information. Haldol (haloperidol)." McNeil Pharmaceutical  (2002):|Heel RC, Brogden RN, Speight TM, Avery GS "Loxapine: a review of its pharmacological properties and therapeutic efficacy as an antipsychotic agent." Drugs 15 (1978):  198-217|Bransgrove LL, Kelly MW "Movement disorders in patients treated with long-acting injectable antipsychotic drugs." Am J Hosp Pharm 51 (1994):  895-9|Owens DGC "Extrapyramidal side effects and tolerability of risperidone - a review." J Clin Psychiatry 55 Suppl (1994):  29-35|Pinder RM, Brogden RN, Swayer R, Speight TM, Spencer R, Avery GS "Pimozide: a review of its pharmacological properties and therapeutic uses in psychiatry." Drugs 12 (1976):  1-40|Sheppard C, Merlis S "Drug-induced extrapyramidal symptoms: their incidence and treatment." Am J Psychiatry 123 (1967):  886-9|Boston Collaborative Drug Surveillance Program "Drug-induced extrapyramidal symptoms." JAMA 224 (1973):  889-91|Mahmood T, Clothier EB, Bridgman R "Risperidone-induced extrapyramidal reactions." Lancet 346 (1995):  1226|Gwinn KA, Caviness JN "Risperidone-induced tardive dyskinesia and parkinsonism." Mov Disord 12 (1997):  119-21|"Product Information. Moban (molindone)." Gate Pharmaceuticals  (2001):|"Product Information. Orap (pimozide)." Gate Pharmaceuticals|Talbert RL, Yee GC, DiPiro JT, Matzke GR, Posey LM, Wells BG "Pharmacotherapy: A Pathophysiologic Approach" Stamford, CT: Appleton & Lange  (1999):|"Product Information. Loxitane C (loxapine)." Apothecon Inc  (2022):', 'DDInter', 0);
