INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20851, 1191, 'Quetiapine', 'Tardive Dyskinesia', 'Tardive dyskinesia (TD) has occurred in patients treated with antipsychotic drugs; the syndrome consists of potentially irreversible, involuntary, dyskinetic movements.  The risk appears highest in older patients (particularly older women) but it is not possible to predict which patients are likely to develop TD; whether antipsychotic drugs differ in their potential to cause TD is unknown.  The risk of TD and the likelihood that it will become irreversible increase with the duration of therapy and the total cumulative dose.  The syndrome can develop after relatively brief treatment periods, even at low dosages; it may also occur after discontinuation of therapy.  TD may remit (partially or completely) upon discontinuation of antipsychotic therapy, although antipsychotic therapy itself may suppress (or partially suppress) signs/symptoms of TD, possibly masking the underlying process; the effect of symptomatic suppression on the long-term course of TD is unknown.  In patients with preexisting drug-induced TD, initiating or increasing the dosage of antipsychotic therapy may temporarily mask the symptoms of TD but could eventually worsen the condition.  In patients requiring chronic therapy, the lowest dose and shortest duration of therapy producing a satisfactory clinical response are recommended; the need for continued therapy should be reassessed periodically.  If signs/symptoms of TD occur during antipsychotic therapy, discontinuation of the offending agent should be considered; however, some patients may require treatment despite the presence of TD.', '2', '"Product Information. Abilify (ARIPiprazole)." Otsuka American Pharmaceuticals Inc  (2020):|"Product Information. Rexulti (brexpiprazole)." Otsuka American Pharmaceuticals Inc  (2021):|"Product Information. Vraylar (cariprazine)." Allergan Inc  (2019):|"Product Information. Latuda (lurasidone)." Sunovion Pharmaceuticals Inc  (2019):|"Product Information. Seroquel (QUEtiapine)." Astra-Zeneca Pharmaceuticals  (2022):|"Product Information. Caplyta (lumateperone)." Intra-Cellular Therapies, Inc.  (2022):|"Product Information. Haldol (haloperidol)." Janssen Pharmaceuticals  (2020):|"Product Information. Thiothixene (thiothixene)." Amneal Pharmaceuticals LLC  (2022):|"Product Information. Clozaril (cloZAPine)." HLS Therapeutics Inc  (2021):|"Product Information. RisperDAL (risperiDONE)." Janssen Pharmaceuticals  (2021):|"Product Information. ZyPREXA (OLANZapine)." Lilly, Eli and Company  (2020):|"Product Information. Moban (molindone)." Endo Laboratories LLC  (2017):|"Product Information. Pimozide (pimozide)." Par Pharmaceutical Inc  (2017):|"Product Information. Geodon (ziprasidone)." Pfizer Inc.  (2022):|"Product Information. Loxapine Succinate (loxapine)." Actavis U.S. (Amide Pharmaceutical Inc)  (2016):|"Product Information. Invega (paliperidone)." Janssen Pharmaceuticals  (2022):|"Product Information. Fanapt (iloperidone)." Vanda Pharmaceuticals Inc  (2017):|"Product Information. Saphris (asenapine)." Schering-Plough Corporation  (2017):', 'DDInter', 0);
