INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20947, 1191, 'Quetiapine', 'Hyperlipidemias', 'According to the manufacturer, patients treated with quetiapine in 3- to 6-week placebo-controlled trials had increases in cholesterol and triglyceride of 11% and 17%, respectively, compared to slight decreases in the placebo group.  Patients with preexisting hyperlipidemia may require closer monitoring during quetiapine therapy, and adjustments made accordingly in their lipid-lowering regimen.', '2', '"Product Information. Seroquel (quetiapine)." Astra-Zeneca Pharmaceuticals  (2001):', 'DDInter', 0);
